def check(rule_id,context,test):
  checkCAC = '(\/cac:[a-zA-Z]+)?'
  checkCND = '(\[[^\]]+\])?'
  check = '[:a-z]*(Invoice|cac:[a-zA-Z]+)'+checkCND+checkCAC+checkCND+checkCAC+checkCND+checkCAC+checkCND+checkCAC+checkCND
  mC = re.findall(check,context)
  _mC = [x[0]+checkCND+x[2]+checkCND+x[4]+checkCND+x[6]+checkCND+x[8]+checkCND for x in mC if ''!=x[8]] + \
        [x[0]+checkCND+x[2]+checkCND+x[4]+checkCND+x[6]+checkCND for x in mC if ''!=x[6] and ''==x[8]] + \
        [x[0]+checkCND+x[2]+checkCND+x[4]+checkCND for x in mC if ''!=x[4] and ''==x[6] and ''==x[8]] + \
        [x[0]+checkCND+x[2]+checkCND for x in mC if ''!=x[2] and ''==x[4] and ''==x[6] and ''==x[8]] + \
        [x[0]+checkCND for x in mC if ''!=x[0] and ''==x[2] and ''==x[4] and ''==x[6] and ''==x[8]]
  _mC = sorted(list(set(_mC)))
  # print(context,_mC)
  mT = re.findall(r'(cac:[a-zA-Z]+\/)*(xs:[a-zA-Z]+\()*(cbc:[a-zA-Z\[\]\@\$\=]+)',test)
  _mT = [x[0]+x[2] for x in mT]
  _mT = sorted(list(set(_mT)))
  rgxs = set()
  if _mC:
    for ctx in _mC:
      for tst in _mT:
        if ctx:
          rgx = '^.*'+ctx.replace(' ','')+'.*'+re.escape(tst.replace(' ',''))+'$'
          rgxs.add(rgx)
        else:
          rgx = '^.*'+re.escape(tst.replace(' ',''))+'$'
          rgxs.add(rgx)
  else:
    for tst in _mT:
      rgx = '^.*'+re.escape(tst.replace(' ',''))+'$'
      rgxs.add(rgx)
  rgxs = list(rgxs)
  if rgxs:
    Pset = set()
    for path in rgxs:
      Ps = [x['PINT_ID'] for x in pint_list if re.match(path,x['Path'])]
      for id in Ps:
        Pset.add(id)
    if Pset:
      Ps = sorted(list(Pset))
      BTs = ' '.join(Ps)
      XPaths = set()
      for id in Ps:
        XPath = [id+'_'+x['Path'] for x in pint_list if id == x['PINT_ID']]
        XPaths.add(XPath[0])
      XPaths = '\n'.join(XPaths)
      print('{0}\ncontext:{1}\ntest:{2}\nRegExs:\n{3}\nFound:{4}\nXPath:\n{5}\n\n'.format(rule_id,context,test,'\n'.join(rgxs),BTs,XPaths))
    else:
      print('{0} NOT FOUND\ncontext:{1}\ntest:{2}\nRegExs:\n{3}\n\n'.format(rule_id,context,test,'\n'.join(rgxs)))

